import "./Contact.scss";

const data = [
    {
        id: 0,
        
    }
]

const Contact = () => {
    return (
        <div className="Contact container">
            <ContactCard icon={PhoneIcon} title="Make a Phone Call" text="+998 99 299 99 96" />
        </div>
    )
}

export default Contact;
